 It's a choice I have to be intentional about every day because life will punch you in the gut sometimes. Having faith isn't about magical, positive thinking but knowing that we tend to make better choices, seek out options, resources, alternatives and friends to share concerns with, if we're coming from a place that's open to the possibilities rather than held captive by fear. It's ok not to be ok but don't let it wash over you. Take 5 minutes to breathe, feel what you're feeling and process it so you can better understand what's stressing you out, see whether or not you have control over it and figure out what you need. Look back at what's helped you or others in the past so you can seek out the next, small step forward. Put your face in the sun and breathe...

